Here's a Swift class that creates a stack of images with a similar layout to the Android class:

```swift
import UIKit

class StackedImages: UIView {
    private var iconScale: CGFloat = 0.7
    private var deviceTypes: [UIImage]

    init(deviceTypes: [UIImage], iconScale: CGFloat = 0.7) {
        self.deviceTypes = deviceTypes
        self.iconScale = iconScale
        super.init(frame: .zero)
        setupLayers()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupLayers() {
        guard deviceTypes.count >= 2 else { return }

        let firstTwo = Array(deviceTypes.prefix(2))
        let secondImage = firstTwo.count > 1 ? firstTwo[1] : firstTwo[0]
        let firstImage = firstTwo[0]

        let imageSize = bounds.width * iconScale
        let inset = (bounds.width - imageSize) / 2

        let secondImageView = UIImageView(image: secondImage)
        secondImageView.frame = CGRect(x: inset, y: inset, width: imageSize, height: imageSize)
        addSubview(secondImageView)

        let firstImageView = UIImageView(image: firstImage)
        firstImageView.frame = CGRect(x: inset, y: inset, width: imageSize, height: imageSize)
        firstImageView.layer.zPosition = 1
        addSubview(firstImageView)
    }
}
```

This Swift class, `StackedImages`, creates a `UIView` with two `UIImageView` subviews stacked on top of each other. The images are scaled and positioned similarly to the Android class. You can initialize this class with an array of `UIImage` and an optional `iconScale` parameter.

